import './Header';
import Header from './Header';
import { useEffect, useState } from 'react';
import { Swiper, SwiperSlide} from 'swiper/react'

function App(){
  const data = [
      {id: 1, imagem: './cyber'}
  ]


  return (
    <div className="App">

      <Header></Header>
      <Swiper slidesPerView={1} pagination={{clickable: true}} navigation>
        {data.map((foto) => (
          <SwiperSlide key={foto.id}>
            <img src='{foto.image}'alt='Slider' className='slide-foto'>

            </img>
          </SwiperSlide>
        ))}

      </Swiper>

    </div>
  );

}
export default App;
